import React from "react";
import logo from "../logo.svg";
import { Link, animateScroll as scroll } from "react-scroll";
import { ProfessionalDevelopment } from './Sections/ProfessionalDevelopment';

const scrollToTop = () => { scroll.scrollToTop() }

const Navbar = () => {
  return (
    <nav className="nav" id="navbar">
      <div className="nav-content">
        <img
          src={logo}
          className="nav-logo"
          alt="Logo"
          onClick={scrollToTop}
        />
        <ul className="nav-items">

          <li className="nav-item">
            <Link
              activeClass="active"
              to="section1"
              spy={true}
              smooth={true}
              offset={-70}
              duration={1000}
            >
              Professional Development
              </Link>
          </li>
          <li className="nav-item">
            <Link
              activeClass="active"
              to="section2"
              spy={true}
              smooth={true}
              offset={-70}
              duration={1000}
            >
              Group and Individual Coaching
              </Link>
          </li>
          <li className="nav-item">
            <Link
              activeClass="active"
              to="section3"
              spy={true}
              smooth={true}
              offset={-70}
              duration={1000}
            >
              Grant Management
              </Link>
          </li>
          <li className="nav-item">
            <Link
              activeClass="active"
              to="section3"
              spy={true}
              smooth={true}
              offset={-70}
              duration={1000}
            >
              Event Planning
              </Link>
          </li>

          <li className="nav-item">
            <Link
              activeClass="active"
              to="section3"
              spy={true}
              smooth={true}
              offset={-70}
              duration={1000}
            >
              Assessment & Accreditation 
              </Link>
          </li>

        </ul>
      </div>
    </nav>
  );
}

export default Navbar;
